request.description:
### /job_to_skills

This endpoint is used to map a job to relevant skills and course recommendations.

#### Request Body

- job (string, required): The job for which skills and course recommendations are to be retrieved.


#### Response

The response is in JSON format and follows the schema below:

``` json
{
    "type": "object",
    "properties": {
        "skills": {
            "type": "array",
            "items": {
                "type": "string"
            }
        },
        "course_recommendations": {
            "type": "array",
            "items": {
                "type": "string"
            }
        }
    }
}

 ```

### POST /skills_to_jobs

This endpoint is used to map skills to available jobs.

#### Request Body
- raw (application/json)
  - skills (array of strings): A list of skills to be mapped to jobs.

#### Response
The response is in JSON format and has the following schema:
```json
{
    "jobs": {
        "type": "array",
        "items": {
            "type": "string"
        }
    }
}
```

