request.description:

### GET /top_demanded_jobs

This endpoint retrieves the top demanded jobs with the specified limit and page number.

#### Request
- Parameters
    - limit (integer, optional): The number of job postings to retrieve. Default is 10.
    - page (integer, optional): The page number for paginated results. Default is 1.

#### Response
- Content-Type: application/json
- Schema:
    ```json
    {
        "type": "object",
        "properties": {
            "top_demanded_jobs": {
                "type": "array",
                "items": {
                    "type": "object",
                    "properties": {
                        "job_title": {
                            "type": "string"
                        },
                        "count_of_job_postings": {
                            "type": "integer"
                        }
                    }
                }
            }
        }
    }
    ```
    - top_demanded_jobs (array): An array of top demanded jobs.
        - job_title (string): The title of the job.
        - count_of_job_postings (integer): The count of job postings for the job title.

### POST /course/recommended

This endpoint is used to retrieve recommended courses for a specific user.

#### Request Body

- user_id (number, required): The ID of the user for whom the recommended courses are being retrieved.


#### Response

The response will be in JSON format with the following schema:

``` json
{
  "type": "object",
  "properties": {
    "content_id": {
      "type": "array",
      "items": {
        "type": "number"
      }
    },
    "content_name": {
      "type": "array",
      "items": {
        "type": "string"
      }
    },
    "Skill_Name_EN": {
      "type": "array",
      "items": {
        "type": "string"
      }
    }
  }
}

 ```

The response will include the recommended course details such as content ID, content name, and skill name in English.

