request.description:
### POST /skills_to_courses

This endpoint is used to map skills to corresponding courses.

#### Request

The request should be sent as a JSON object in the request body with the following parameter:

- `skills` (array of strings): Specifies the skills to be mapped to courses.


Example:

``` json
{
    "skills": [""]
}

 ```

#### Response

Upon successful execution, the API returns a JSON object with the following parameter:

- `courses` (array of integers): Contains the list of courses mapped to the provided skills.


Example:

``` json
{
    "courses": [0]
}

 ```

#### JSON Schema for Response

``` json
{
    "type": "object",
    "properties": {
        "courses": {
            "type": "array",
            "items": {
                "type": "integer"
            }
        }
    }
}

 ```

