### POST /skills_to_emsi

This endpoint takes a list of skills and maps them to corresponding data from EMSI.

#### Request Body

- Type: Raw (application/json)
- Payload:

    ``` json
    {
        "skills":[""]
    }

     ```


#### Response

The response is in JSON format and includes the following fields:

- `fx` (array\[object\]): Contains data related to skills mapping to FX.
    - `id` (number): The ID of the skill mapping.
    - `name` (string): The name of the skill mapping.
- `emsi` (array\[object\]): Contains data related to skills mapping to EMSI.
    - `id` (string): The ID of the skill mapping.
    - `name` (string): The name of the skill mapping.
- `others` (array\[object\]): Contains other data related to the skills mapping.
    - `name` (string): The name of the skill mapping.

#### JSON Schema

``` json
{
  "type": "object",
  "properties": {
    "fx": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "number"
          },
          "name": {
            "type": "string"
          }
        }
      }
    },
    "emsi": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "string"
          },
          "name": {
            "type": "string"
          }
        }
      }
    },
    "others": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "name": {
            "type": "string"
          }
        }
      }
    }
  }
}

 ```

